import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import FrontPage from "./Components/Pages/FrontPage";
import Contact from "./Components/Pages/Contact";
import MailingList from "./Components/Pages/MailingList";
import Shop from "./Components/Pages/Shop/Shop";
import Jackets from "./Components/Pages/Shop/Jackets";
import Tops from "./Components/Pages/Shop/Tops";
import Shirts from "./Components/Pages/Shop/Shirts";
import Pants from "./Components/Pages/Shop/Pants";
import Accessories from "./Components/Pages/Shop/Accessories";
import AdminView from "./Components/Pages/AdminView";
import Cart from "./Components/Pages/Cart";
import ProtectedRoutes from "./Components/Pages/ProtectedRoutes";
import item from "./Data/inventory.json";

export default function App() {
  const items = item;
  console.log(items.map(({ id }) => id));
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" exact element={<FrontPage />} />
          <Route
            path="/shop"
            exact
            element={<Shop key={items} items={items} />}
          />
          <Route
            path="/cart"
            exact
            element={<Cart key={items["id"]} items={items} />}
          />
          <Route path="/shop/jackets" exact element={<Jackets />} />
          <Route path="/shop/accessories" exact element={<Accessories />} />
          <Route path="/shop/tops" exact element={<Tops />} />
          <Route path="/shop/shirts" exact element={<Shirts />} />
          <Route path="/shop/pants" exact element={<Pants />} />
          <Route path="/contact" exact element={<Contact />} />
          <Route path="/mailing-list" exact element={<MailingList />} />
          <Route element={ProtectedRoutes}>
            <Route path="/admin" exact element={<AdminView />}></Route>
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}
